import React, { useState } from "react";

function CreateArea() {
  const [note, setNote] = useState({
    content: "",
  });

  function handleChange() {}
  return (
    <div>
      <form>
        <textarea
          name="content"
          value={note.content}
          onChange={handleChange}
          placeholder="Add Todo task..."
          rows="3"
        />
        <button>+</button>
      </form>
    </div>
  );
}

export default CreateArea;
